import axios from 'axios';

const API_GET_MISC = () => {
    return new Promise((resolve, reject) => {
            
        //Make the call 
        axios.get(`https://photo-cms-api.onrender.com/api/imageurl/misc/james@email.com`)
            .then((response) => {
                resolve(response.data);
            })
            .catch((error) => {
                reject(error);
            });
        }
    ) 
}

export default API_GET_MISC